CREATE TABLE vishny00_acc.acc_product_prices
(
    id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    price_count float,
    createdAt datetime NOT NULL,
    updatedAt datetime NOT NULL,
    accProductId int(11),
    accPriceTypeId int(11),
    CONSTRAINT acc_product_prices_ibfk_1 FOREIGN KEY (accProductId) REFERENCES vishny00_acc.acc_products (id) ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT acc_product_prices_ibfk_2 FOREIGN KEY (accPriceTypeId) REFERENCES vishny00_acc.acc_price_types (id) ON DELETE SET NULL ON UPDATE CASCADE
);
CREATE INDEX accProductId ON vishny00_acc.acc_product_prices (accProductId);
CREATE INDEX accPriceTypeId ON vishny00_acc.acc_product_prices (accPriceTypeId);
